    - type: text
      text:
        content: 'Brief Introduction: 我們都知道，時間就是金錢，如果你可以做好時間管理，一天24個小時你可以做到很多事，相反地，如果你對時間很沒有概念，你可能一整天只做了幾件事…因此，在這次的show中，我想跟大家一起來探討時間管理對人有多重要，並且你滑下去可以看到我有放幾個跟本次議題相關的連結，點進去看看，或許你可以更瞭解其重要性，並跟我們分享你從裡面得到了什麼！甚至你在影片、文章中可以找到一些還滿實用的小技巧呢！'
